description.text:
This is not likely to be useful printed as is without customising it for your project.<br />
Inside the main function, you will find a list of parameters:
//Define your screw hole diameter and depth for fixing the lid on<br />
screw_hole_dia = 3;<br />
screw_hole_depth = 10;
screw_hole_head_countersink_dia = 6;<br />
screw_hole_head_countersink_depth = 0.5;
//This usually seems sensible, but you might need to adjust it for strange combinations of screw hole and box corner radius to ensure your pillars are 'fused' suitably with the sides of the box. - can go negative as well as positive if needed.<br />
pillar_offset_tweak = 0;
Customise these to specify the box you want to create.  Enjoy!<br />
Any bugfixes etc, please contact me so I can improve this thing!
Thanks!
